Set tSC = $$$OK
Try
{
	&SQL(Insert into Custom_BRSC_iknow.ClinicalNotes 
	(PatientID, DocumentNumber, EventDate, Type, Facility, DoctorName, Purpose, Notes)
	Select b.MPIID, a.DocumentNumber, TO_CHAR(DocumentTime_Date,'DD/MM/YYYY') DocumentDate, DocumentType, EnteredAt_Code, Clinician_Name, DocumentName, NoteText 
	from HSView.Documents a, HSView.Patients b 
	where a.Patient_Id = b.Patient_Id and (Select top 1 1 from Custom_BRSC_iknow.ClinicalNotes n where n.PatientId = b.MPIID and n.DocumentNumber = a.DocumentNumber) <> 1 )

	SET myquery="SELECT ID FROM Custom_BRSC_iknow.ClinicalNotes"
	SET tStatement = ##class(%SQL.Statement).%New()
	SET qStatus = tStatement.%Prepare(myquery)
	IF qStatus'=1 { WRITE "%Prepare failed",$System.Status.DisplayError(qStatus) QUIT}
	SET rset = tStatement.%Execute()
	while rset.%Next()
	{
	 	set note = ##class(Custom.BRSC.iknow.ClinicalNotes).%OpenId(rset.%Get("ID"))
		set note.Notes = $REPLACE($REPLACE($REPLACE(note.Notes,"nao","não"),"Nao","Não"),"usencia","usência")
		//set note.Notes = $REPLACE($TRANSLATE(note.Notes,"ÇÃÕÀÁÉÍÓÚÂÊÎÔÛçãõàáéíóúâêîôû","CAOAAEIOUAEIOUcaoaaeiouaeiou"),"º","o.")
		do note.%Save()
	}

	//DO rset.%Display()

}
Catch tErro
{
	Set tSC = tErro.AsStatus()
	w $System.Status.DisplayError(tSC),!
}
quit tSC

write !,"Importing Note: ",pFile

kill f
set f=##class(%File).%New(pFile)
do f.Open("RS")

set note=..%New()
write !,"File: ",f.AtEnd

set inNotes=0
while 'f.AtEnd {
	set ln=f.ReadLine()
	write !,"Processing: ",ln

	if inNotes {
		set note.Notes=note.Notes_" "_$ZSTRIP(ln, "<>W")
		write !,"Notes added: ",ln
	}
	elseif ln="" {
		set inNotes=1
	}
	else {
		set prop=$P(ln, ":", 1)
		set val=$ZSTRIP($P(ln, ":", 2), "<>W")

		if prop="Patient" { set note.PatientID=val }
		elseif prop="Date" { set note.EventDate=val }
		elseif prop="Type" { set note.Type=val }
		elseif prop="Purpose" { set note.Purpose=val }
		else {
			write !,"Warning: Unknown prop type in note [",ln,"]. Continuing"
		}
	}
}

set sc=note.%Save()
quit sc

