			set entOccs = pathObj.EntityOccurrences
			for j=1:1:$listlength(pathEnts) {
				set entId = $list(pathEnts,j)
				continue:entId=0
				set entOcc = ##class(%iKnow.Objects.EntityOccurrence).PKINDEXOpen(domainId, $list(entOccs,j))
				set ent = ##class(%iKnow.Queries.EntityAPI).GetValue(domainId, entId)
				set tPO = ##class(%ZEN.proxyObject).%New()
