					if $d(tHighlight(entOcc.EntUniId)) {
						set tPO.text = ent
						set tPO.type = "hc"
					} else {
						set tPO.text = ent
						set tPO.type = "c"
					}
				} else {
					set tPO.text = ent
					set tPO.type = "r"
				}
				Do tPathEnts.Insert(tPO)	

			}
			set i = i + 1
			set tPC.pathEnts = tPathEnts
			Do tPMC.paths.Insert(tPC)
		}
		if ($data(%request)) {Set %response.ContentType="application/json"}
