					//console.log(encodeURI($scope.url+"/concepts/"+$scope.iknowDomain+"/"+$scope.filtroMDX()+"/0/1"));
					paginacao($scope.conceitos, data.entities, $scope.button.resultType);
					if ($scope.dataInicial) {
