			var carregarPeriodo = function (colecao, prop) {
				mdxquery = "SELECT NON EMPTY "+$scope.dateDimension+".Members ON 1 FROM "+$scope.cubeName+" %FILTER "+$scope.filtroMDX()
				$http.get(encodeURI($scope.url+"/mdxquery/"+mdxquery)).success(function (data) {
					  titulo="[Todas]";
					  if ($scope.conceitoSelecionado) {titulo="["+$scope.conceitoSelecionado+"]"} 
					  defineGraficoEvolutivo(data.yNodes,"Fontes no Periodo "+ titulo);
					  $('#evol').highcharts($scope.graficoEvolutivo);
				}).error(function (data, status) {
					//console.log("aconteceu um problema "+data);
					$scope.message = "Aconteceu um problema: " + data;
				});
			};

			$scope.filtroMDX = function()
			{
					if ($scope.patientId) {
						pacienteF = $scope.patientDimension+".&["+$scope.patientId+"]";
					}
					else {
						pacienteF = "";
					}
					if ($scope.fDataInicialBase) {
						periodoFBase = "%OR("+$scope.dateDimension+".&["+$scope.fDataInicialBase+"]:&["+$scope.fDataFinalBase+"])";
					}
					else {
						periodoFBase = "";
					}
					if ($scope.fDataInicial) {
						periodoF = "%OR("+$scope.dateDimension+".&["+$scope.fDataInicial+"]:&["+$scope.fDataFinal+"])";
					}
					else {
						periodoF = "";
					}
					if ($scope.conceitoSelecionadoId) {
						conceitoF = $scope.conceptDimension+".&["+$scope.conceitoSelecionadoId+"]";
					}
					else {
						conceitoF = "";
					}
					baseF = "NONEMPTYCROSSJOIN("+pacienteF+",NONEMPTYCROSSJOIN("+periodoFBase+",NONEMPTYCROSSJOIN(,NONEMPTYCROSSJOIN("+periodoF+","+conceitoF+"))))";
					return baseF;
			}

			$scope.par = function (index)
			{
				return ((index)%2==0)	
			}

			var carregarConceitosS = function (entity, collection) {
