			var carregarFontes = function (entity, collection) {
				console.log(encodeURI($scope.url+"/sourcebyconcept/"+$scope.iknowDomain+"/"+$scope.filtroMDX()+"/"+entity+"/"+$scope.sourceDateColumn+"/"+$scope.sourceMetadata))
				$http.get(encodeURI($scope.url+"/sourcebyconcept/"+$scope.iknowDomain+"/"+$scope.filtroMDX()+"/"+entity+"/"+$scope.sourceDateColumn+"/"+$scope.sourceMetadata)).success(function (data) {
					collection.itens = data;
