			$scope.selecionarConceito = function (entity, action, orig) {
				if (($scope.conceitoSelecionado===entity)&&(action=="unselect"))
				{
					entity="";
				}
				entity = entity.trim();
				$scope.criterioDeBusca = "";
				if (action === "drilldown"){
					$scope.conceitoSelecionadoAnt.push(entity);
				}
				else if (action === "drillup"){
				 	$scope.conceitoSelecionadoAnt.pop();
				 	if ($scope.conceitoSelecionadoAnt.length===0) {
					 	entity=""}
					else {
						entity = $scope.conceitoSelecionadoAnt[$scope.conceitoSelecionadoAnt.length-1].trim()
					}
				}
				else{
					$scope.conceitoSelecionadoAnt = [];	
				}
				$scope.conceitoSelecionado = entity;
				$scope.conceitoSelecionadoId = "";
				if (entity === "") {
					$scope.conceitosS.itens=[];
					$scope.conceitosR.itens=[];
					$scope.paths.itens = [];
					$scope.ccs.itens=[];
					$scope.crcs.itens=[];
					$scope.fontes.itens = [];
					$scope.conceitoTmp.datas=[];
					//if (!$scope.dataInicial) {carregarPeriodo($scope.conceitoTmp,'datas')};
					carregarPeriodo($scope.conceitoTmp,'datas');
				}
				else {
					$scope.conceitosS.paginaAtual=1;
					$scope.conceitosR.paginaAtual=1;
					$scope.crcs.paginaAtual=1;
					$scope.ccs.paginaAtual=1;
					$scope.paths.paginaAtual=1;
					$scope.fontes.paginaAtual=1;
	                carregarConceitosS(entity,$scope.conceitosS);
	                carregarConceitosR(entity,$scope.conceitosR);
	                carregarCRCs(entity,$scope.crcs);
	                carregarCCs(entity,$scope.ccs);
	                carregarPaths(entity,$scope.paths);

					$scope.conceitoSelecionadoId = Enumerable.from($scope.conceitos.itens)
				    			.where(function (x) { return x.entity === entity })
							    .select(function (x) { return x.entUniId})
								.toArray()[0];	

					if ($scope.conceitoSelecionadoId){
						if (action!="periodFilterDDown") {carregarPeriodo($scope.conceitoTmp,'datas')};
						carregarFontes($scope.conceitoSelecionado,$scope.fontes);
					}
				}
			}

			$scope.tituloGrafico = function() { 
				titulo = 'Top ' + $scope.button.topX + ' Conceitos ' + $scope.opcaoVisualizacao;
				if ($scope.conceitoSelecionado) {titulo = titulo + " [" + $scope.conceitoSelecionado + "]" };
				return titulo;
