			  "resultType": "frequency",
			  "drilldownType": 0,
			  "topX": 5
			};

			$scope.selecionarGrafico = function(){
				$scope.selecionarConceito("","unselect",1);
				if ($scope.button.resultType==='frequency') {$scope.opcaoVisualizacao='por Frequencia'}	
				if ($scope.button.resultType==='spread') {$scope.opcaoVisualizacao='por Qtd. de Fontes'}	
				if ($scope.button.resultType==='score') {$scope.opcaoVisualizacao='por Dominância'}	
				if ($scope.button.chartType === 0) {
					defineGraficoBarras($scope.conceitos.itens,$scope.button.resultType,$scope.button.topX);
					$('#bar').highcharts($scope.grafico1D);
				}
				else if ($scope.button.chartType === 1) {
					defineGraficoBolha($scope.conceitos.itens,$scope.button.topX);
					$('#bubble').highcharts($scope.grafico3D);
				}
				else if ($scope.button.chartType === 2) {
					defineGraficoTorta($scope.conceitos.itens,$scope.button.resultType,$scope.button.topX);
					$('#pie').highcharts($scope.grafico1D);
				}
				else if ($scope.button.chartType === 3) {
					$scope.conceitos.tamanhoPagina = $scope.button.topX;
					$scope.conceitos.paginaAtual=1;
					paginacao($scope.conceitos,$scope.conceitos.itens, $scope.button.resultType);

				}
				if (!$scope.dataInicial) {
					$('#evol').highcharts($scope.graficoEvolutivo);
				};
			}

			var paginacao = function (obj, itens, campo) {
				obj.itens = Enumerable.from(itens)
							    .orderByDescending(function (x) { return x[campo]*1 })
							    .select(function (x) { return x})
							    .toArray();
				if (itens)
				{
					obj.totalPaginas = Math.ceil((itens.length / obj.tamanhoPagina));
					if (obj.totalPaginas < 1) obj.totalPaginas = 1;
					for (idx in obj.itens)
					{
						pagina = ((idx+1)/obj.totalPaginas)*(obj.totalPaginas/obj.tamanhoPagina);
						obj.itens[idx].pag = Math.ceil(pagina/10)
						obj.itens[idx].paginaAtual = function () {
							return obj.paginaAtual;
						};
					};
				};
			};

			var defineGraficoBolha = function(conceitos,topX) {
				obj = {};
				obj.chart = {};
            	obj.chart.borderWidth= 1;
				obj.chart.type = 'bubble';
				obj.chart.zoomType = 'xy';
				obj.title = {};
