			$scope.highlight = function(text, search) {
			    return $sce.trustAsHtml(text);
			    if (!search) {
			        return $sce.trustAsHtml(text);
			    }
			    termos=[]
			    tx = text.split('[');
				for (idx in tx){
					f = tx[idx].search('[\\]]')
					if (f > 0) {
						termo=tx[idx].substring(0,f);
						termos.push(termo);
					}
				};	
				for (idx in termos){
				 	text=text.replace(new RegExp(termos[idx], 'gi'), '<span class="highlightedText">$&</span>');
				};
				text=text.replace(new RegExp(search, 'gi'), '<span class="highlightedConcept">$&</span>');
			    return $sce.trustAsHtml(text);
			};

